import React, { useState } from "react";
import Axios from "axios";

function Corporation() {
  const [name, setName] = useState("");

  const findStocks = () => {
    console.log(name);
    Axios.post("http://localhost:3000/corporations", {
      name: name,
    }).then(() => console.log("success"));
  };

  const findAllStocks = () => {
    console.log(name);
    Axios.post("http://localhost:3000/corporationsAll").then(() =>
      console.log("success")
    );
  };

  return (
    <section>
      <div className="information">
        <label>Corporation: </label>
        <input
          type="text"
          onChange={(event) => {
            setName(event.target.value);
          }}
        />
        <button onClick={findStocks}>Find Corporations</button>
      </div>

      <button onClick={findAllStocks}>Show Corporations</button>
    </section>
  );
}

export default Corporation;
